class Xyz:
    WhiteReference = (95.047, 100.00, 108.883)
    Epsilon = 0.008856
    Kappa = 903.3

    def initialize(self, rgb):
        self.X, self.Y, self.Z = self.to_color_space(rgb)

    def CubicRoot(self, n):
        return pow(n, 1.0 / 3.0)

    def to_color_space(self, rgb):
        r = self.pivot_rgb(rgb[0] / 255.0)
        g = self.pivot_rgb(rgb[1] / 255.0)
        b = self.pivot_rgb(rgb[2] / 255.0)

        return (
            r * 0.4124 + g * 0.3576 + b * 0.1805,
            r * 0.2126 + g * 0.7152 + b * 0.0722,
            r * 0.0193 + g * 0.1192 + b * 0.9505
        )

    def to_color(self, Xyz):
        x = Xyz[0] / 100.0
        y = Xyz[1] / 100.0
        z = Xyz[2] / 100.0

        r = x * 3.2406 + y * -1.5372 + z * -0.4986
        g = x * -0.9689 + y * 1.8758 + z * 0.0415
        b = x * 0.0557 + y * -0.2040 + z * 1.0570

        return (
            self.to_rgb(r),
            self.to_rgb(g),
            self.to_rgb(b)
        )

    def to_rgb(self, n):
        r = 255.0 * n
        if r < 0: return 0
        if r > 255: return 255
        return r

    def pivot_rgb(self, n):
        return (pow((n + 0.055) / 1.055, 2.4) if n > 0.04045 else n / 12.92) * 100.0


class Lab:
    def __init__(self, rgb):
        self.L, self.A, self.B = self.to_color_space(rgb)

    def cubic_root(self, n):
        return pow(n, 1.0 / 3.0)

    def pivot_xyz(self, n):
        return self.cubic_root(n) if n > Xyz.Epsilon else ((Xyz.Kappa) * n + 16) / 116

    def to_color_space(self, rgb):
        xyz = Xyz()
        xyz.initialize(rgb)

        whiteX, whiteY, whiteZ = xyz.WhiteReference
        x = self.pivot_xyz(xyz.X / whiteX)
        y = self.pivot_xyz(xyz.Y / whiteY)
        z = self.pivot_xyz(xyz.Z / whiteZ)

        return (
            max(0, 116 * y - 16),
            500 * (x - y),
            200 * (y - z)
        )

    #NOT SURE to be tested
    def to_color(self, lab):
        y = (lab.L + 16.0) / 116.0
        x = lab.A / 500.0 + y
        z = y - lab.B / 200.0

        white = Xyz.WhiteReference
        x3 = x * x *x
        z3 = z * z *z

        xyz = Xyz()
        xyz.X = white[0] * (x3 if x3 > Xyz.Epsilon else (x - 16.0 / 116.0) / 7.787)
        xyz.Y = white[1] * (pow(((lab.L + 16.0) / 116.0), 3) if (lab.L > (Xyz.Kappa * Xyz.Epsilon)) else lab.L / Xyz.Kappa)
        xyz.Z = white[2] * (z3 if z3 > Xyz.Epsilon else ((z - 16.0 / 116.0) / 7.787))

        return xyz.to_color(xyz)


def deltaE(l1, l2):
    return math.sqrt(pow(l1.L - l2.L, 2) + pow(l1.A - l2.A,2) + pow(l1.B - l2.B,2))

